function listProducts(accessToken,storeId){
    try {
        const options = {
            method: 'GET',
            headers: {Accept: 'application/json', Authorization: `Bearer ${accessToken}`}
        };
        return fetch(`https://app.ecwid.com/api/v3/${storeId}/products`, options);
        
    } catch (error) {
        console.log(error);        
    }
}
